import { useContext } from 'react';
import { useHistory } from 'react-router-dom';
import { AppContext } from './context/appContext';


export const ResultsProfile = () => {
    const {
        // setMood,
        playlistTracks,
        found
    } = useContext(AppContext);

    let history = useHistory();

    const mappedTracks = playlistTracks.items && playlistTracks.items.map(item =>
        <div className='list-decimal list-inside text-'>
            <p className='list-item text-cerise-200' key={item.id}> {item.track.name} <span className='text-cerise-50'> from </span> {item.track.album.name} </p>
        </div>
        );
        console.log(playlistTracks)
    return(
        <div className='container-main'>
            <button onClick={() => history.goBack()} className='btnbold-small bg-cerise-700 text-sm'> go back </button>
            <div className='container-main text-center bg-indigo-900 rounded'>
                <a className='text-4xl p-3' href={`https://open.spotify.com/playlist/${found.id}`}> {found.name} </a>
                {mappedTracks}
                <button className='btn bg-indigo-800 mt-7'> analyze tracks </button>
            </div>
        </div>
    )
};
